import React, { useState, useContext, useEffect } from "react";
import { IUser } from "../../../domain/IUser";

interface IProps {
    teachers: IUser[];
}
const TeacherIndexBody = (props: IProps) => {
    const [items, setItems] = useState(props.teachers as IUser[]);

    useEffect(() => {
    }, [items]);


    return (<>

        {items.map(t => (

            <tr key={t.id}>
                <td>
                    {t.email}
                </td>
                <td>
                    {t.firstName}
                </td>
                <td>
                    {t.lastName}
                </td>
            </tr>
        ))}

    </>);

}

export default TeacherIndexBody;
